import React from "react";
import { ReactComponent as Phone } from "../images/phone.svg";
import { ReactComponent as Mail } from "../images/mail.svg";
import { ReactComponent as Home } from "../images/home.svg";
import { ReactComponent as Linkedin } from "../images/linkedin.svg";

const Contact = ({ contact }) => {
  return (
    <li>
      <Phone /> <p className="contact-information">{contact.phone}</p>
      <Mail /> <p className="contact-information">{contact.email}</p>
      <Home /> <p className="contact-information">{contact.website}</p>
      <Linkedin /> <p className="contact-information">{contact.linkedin}</p>
    </li>
  );
};

export default Contact;
